    Description: !ruby/object:NWN::Gff::Element 
      label: Description
      str_ref: 4294967295
      type: :cexolocstr
      value: !ruby/object:NWN::Gff::CExoLocString 
        languages: 
          4: "Selten findet man ihresgleichen so hoch im Norden, und manch einer mag sich \xFCber die Herkunft der exotischen Sch\xF6nheit wundern, die vor ihm steht. Schlank, hochgewachsen, mit sonnengebr\xE4unter Haut und nachtschwarzen Haar entspricht sie dem Sinnbild der sch\xF6nen Calishitin oder auch Mulanerin, sodenn man eine findet sie sich nicht wie \xFCblich den Kopf schert.\n\n\
            Davon abweichen w\xFCrden allerdings die Augen, die in strahlendem Himmelsblau zu leuchten scheinen. Ebenso auffallend ist dass selbst bei v\xF6lliger Windstille stets eine laue Brise durch ihr Haar und ihre meist leichte Kleidung zu flattern scheint.\n\n\
            Meist ziert ein L\xE4cheln ihre Lippen, und ihre Stimme ist von sanfter, leicht rauchiger Natur, und scheint weniger f\xFCr scharfe Worte geschaffen als daf\xFCr, einen Gespr\xE4chspartner in ihren Bann zu ziehen. Sie scheint auch vielerlei Sprachen zu beherrschen, nach einem bestimmten Akzent sucht man hierbei vergeblich.\n\n\
            Eine arkane Untersuchung ergibt nichts weiter auff\xE4lliges."
